CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "productos_producto" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nombre" varchar(100) NOT NULL, "descripcion" text NOT NULL, "precio" decimal NOT NULL, "categoria_id" bigint NULL REFERENCES "productos_categoria" ("id") DEFERRABLE INITIALLY DEFERRED, "publicado_por_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "imagen" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "productos_perfilusuario" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "carrera" varchar(100) NOT NULL, "usuario_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "telefono" varchar(15) NULL, "foto" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "productos_mensaje" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "contenido" text NOT NULL, "timestamp" datetime NOT NULL, "emisor_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "producto_id" bigint NOT NULL REFERENCES "productos_producto" ("id") DEFERRABLE INITIALLY DEFERRED, "receptor_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "leido" bool NOT NULL);
